          body: "# Release v0.177.0\n\n## \U0001F680 Features\n\n- Add utils command
            to migrate iamidentitymappings to EKS access entries (#7710)\n- Add support
            for Ubuntu Pro 22.04 based EKS images (#7711)\n\n## \U0001F3AF Improvements\n\n-
            Handle K8s service account lifecycle on eksctl create/delete podidentityassociation
            commands (#7706)\n\n## \U0001F41B Bug Fixes\n\n- Fix reusing instanceRoleARN
            for nodegroups authorized with access entry (#7707)\n- Allow nodegroup
            creation after a cluster subnet is deleted (#7714)\n- Fix arn build logic
            to support different aws partitions (#7715)\n\n## \U0001F9F0 Maintenance\n\n-
            Disable IMDSv1 in unowned integration tests (#7722)\n\n## Acknowledgments\n\nThe
            eksctl maintainers would like to sincerely thank @punkwalker, @veekaly,
            @aciba90 and @timandy\n"
