            AL2 ARM64 nodegroups (#7821)\n- Subnets availability validation should
            use AZs resolved by `EC2::DescribeSubnets` call (#7816)\n- Fix Github
            workflow for updating generated files for default addons (#7766)\n\n##
            \U0001F4DD Documentation\n\n- Fix typo for iam policy (#7820)\n- Fix formatting
            for notes in documentation (#7817)\n\n## Acknowledgments\n\nThe eksctl
            maintainers would like to sincerely thank @practicusai and @richzw.\n\n\n"
